import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Heading from './App';
import {sum, sub, divide, multiply} from './App';

const root = document.getElementById('root');

// let name = "Earthrelmer";


ReactDOM.render(
  <Heading></Heading>,
  root
)

const red = document.getElementById('red');


document.getElementById('button').addEventListener('click', ()=> {


    ReactDOM.render(
      <Outputs></Outputs>,
      red
    )
})

function Outputs () {
  let one = document.getElementById('fval').value;
  let two = document.getElementById('sval').value;

  let a = Number(one);
  let b = Number(two);

    return (
      <div className="sol">
        <p>{`Sum of the Two number is`} <span>{`${sum(a,b)}`}</span></p>
        <p>{`Differnece of the Two number is`} <span>{`${sub(a,b)}`}</span></p>
        <p>{`Product of the Two number is`} <span>{`${multiply(a,b)}`}</span></p>
        <p>{`Division of the Two number is`} <span>{`${divide(a,b)}`}</span></p>
      </div>
    )
}


const arr = ['one', 'two', 'three'];
